import React, {useState, useEffect} from "react"
import Header from "./header"
import Footer from "./footer"
import Note from "./note"

function App(){
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);   
  

  return (
    <div>
    <Header title = "Hello"/>
    <Note />
  
    <Footer />
    </div>

  )
};

export default App;
